import React from 'react';

const JsonData = () => {

    const dataTake = [
        {
            city: "Shikshon",
            zip: "1205"
        },
        {
            city: "Nowabganj",
            zip: "1211"
        },
        {
            city: "Tantibazar",
            zip: "1100"
        },
        {
            city: "KawranBazar",
            zip: "1300"
        }
    ]

    const DataItem = dataTake.map((data) => {
        return <option> {data.city} </option>
    })



    return (
        <div className="mt-5 text-center">
            <h1 className="ProColor"> JsonData এর কাজ </h1>

            <select>
                {DataItem}
            </select>

        </div>
    );
};

export default JsonData;
